import React, { Component } from "react";
import ReactDOM from "react-dom";
import Rating from "material-ui-rating";
import { Button } from "@material-ui/core";
import Example from '../example'
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';

class ListOfProjects extends Component {
  constructor(props) {
    super(props);
    this.MouseMove = this.MouseMove.bind(this);
    this.click = this.click.bind(this);
    this.clicko = this.clicko.bind(this);
  }
  MouseMove() {
    ReactDOM.render(
      <div>
        <img src={this.props.photo} onClick={this.clicko} />
        <p>
          {this.props.id}.{this.props.name}{" "}
        </p>
      </div>,
      document.getElementById("filmName")
    );
  }
  click() {
    ReactDOM.render(
      <div>
        <img src={this.props.photo} />
        <p>
          {this.props.id}.{this.props.name} Рeйтинг: {this.props.rayt}
        </p>
          	<Rating value={this.props.rayt} max={5} />
      </div>,
      document.getElementById("filmName")
    );
  }
  clicko() {
      ReactDOM.render(
      <div>
      <Router>
        <div>
         {/*  <ul>
            <li>
              <Link to="/dop" class="active">Запустить видео</Link>
            </li>
          </ul> */}
          <Switch>
            <Route component={DopComponent} path="/dop" />
          </Switch>
        </div>
      </Router>
       </div>,
       document.getElementById("video")
    ); 
  }
  render() {
    return (
      <div>
        <div id="im">
          <img
            className="photo"
            src={this.props.photo}
            onMouseMove={this.MouseMove}
            onClick={this.click}
          />
          <div id = "video" onClick={this.clicko} style={{ cursor: "pointer" }}>
            {this.props.name}{" "}
          </div>
        </div>
      </div>
    );
  }
}
