function DopComponent() {
  return (
    <div className="App">
     <header className="App-header">
        <div className="but">
          <Button
            variant="outlined"
            color="primary"
            className="App-link"
            href="https://youtu.be/2g811Eo7K8U"
            target="_blank"
            rel="noopener noreferrer"
          >
            Посмотреть видео
          </Button>
        </div>
      </header> 
      <div>
        <Example />
      </div>
    </div>
  );
}
export default ListOfProjects;
